INSERT INTO `entradas` (`id`, `id_usuario`, `id_categoria`, `titulo`, `descripcion`, `fecha`, `imagen`) VALUES
(21, 11, 2, 'San Lorenzo Vs Platense', 'Así sí, San Lorenzo. Podrá costarle, retrasarse por inercia en algunos momentos y ser algo irregular, lógico porque el plantel -y el 11 titular- está compuesto en su gran mayoría por jóvenes, pero muestra buenas cosas y lentamente empieza a justificar más sus triunfos. Este martes a la noche contra Platense no fue la excepción: con un fútbol por momentos interesante y por otros práctico, sumó tres puntos clave para acomodarse en la tabla, seguir con el objetivo de engrosar el promedio y quedar a cinco unidades de la Sudamericana.\r\n\r\n¿Por qué no ilusionarse y aspirar a más? Si sostiene este trabajo de hormiga.\r\n\r\nAcaso la deuda sea empezar a sostener las buenas asociaciones durante más tiempo: frente a un Calamar que careció de ideas para llevarle peligro a Batalla, en la segunda mitad se retrasó más en el campo y dejó de atacar con tanta gente. Instinto de supervivencia: tal es la necesidad de ganar que el propio DT metió mano en el entretiempo tras un gran PT para asegurar el cero en su arco (entró Giay por Martegani y armó una línea de cinco permanente), apostando a atacar menos pero con más precisión.\r\n\r\nEl todoterreno Elías formó un doble cinco con Méndez y juntos clausuraron el centro del campo, aunque resignando la posesión.\r\n\r\nTerminó siendo clave para San Lorenzo trasladar al marcador el buen trabajo hecho a lo largo de los primeros 45’: ese gol de Hernández (dos cabezazos en el área...) le dio tranquilidad y un empujón anímico para seguir apostando a lo mismo. Controlando la posesión con Méndez y Martegani -quienes se empiezan a conocer- y explotando las bandas con Barrios y Cerutti (figura total), para terminar con el goleador Bareiro.\r\n\r\nLa clave pasó por el desnivel por afuera que generó el equipo de Insua: los creativos rápidamente buscaron a Fernández Mercau, el Perrito y el Pocho, cosa que rompió a un pobre Platense. Siempre con el respaldo de una última línea nutrida, que es de tres pero que por momentos se transforma en una de cinco: eso también les da libertad a Gattoni (otra vez como si tuviera 10 años en Primera) y Hernández para pasar la mitad de la cancha.', '2022-08-18 03:00:00', );
INSERT INTO `entradas` (`id`, `id_usuario`, `id_categoria`, `titulo`, `descripcion`, `fecha`, `imagen`) VALUES
(22, 11, 9, 'Cocker Spaniel', 'El Cocker Spaniel Inglés es un can con una complexión delgada que le proporciona una figura esbelta. Se trata de un perro de un tamaño medio que se caracteriza, principalmente, por su pelo liso y largo que, en ciertas zonas del cuerpo (orejas, pecho y patas), adopta cierta ondulación. El color más común de esta raza es el dorado, aunque los tonos aceptados son diversos y pueden combinarse en forma de manchas: negro, chocolate, rojo o blanco, entre otros.\r\n\r\nEl Cocker Spaniel Inglés tiene una musculatura destacada. Aunque el pelaje es abundante, se puede apreciar un contundente pecho, una espalda sólida e inclinada hacia arriba, un vientre duro y unas costillas bien arqueadas. Las patas tienen una corta altura y destacan por su fortaleza. Por su parte, la cola permanece baja y tiene una longitud media.\r\n\r\nLa cabeza está unida a este cuerpo mediante un cuello corto y musculado que no presenta papada. Son muy características las enormes orejas finas y en forma de lóbulo que caen hacia los laterales de su cara. Cuando el can alcanza la edad adulta, ¡estas orejas son más largas que su propia cabeza! Se contempla un cráneo bien marcado, unos ojos marrones grandes y un hocico alargado con unos belfos algo caídos.', '2022-08-18 03:00:00', );
INSERT INTO `entradas` (`id`, `id_usuario`, `id_categoria`, `titulo`, `descripcion`, `fecha`, `imagen`) VALUES
(23, 11, 12, 'PHP', 'PHP (Hypertext Pre-Processores) es un lenguaje de programación de código abierto utilizado en la creación de páginas webs y aplicaciones webs, el código puede incrustarse en HTML al ser muy versatil favorece la conexión entre servidores e interfaz de usuarios.\r\n\r\nEl origen de PHP surgió como una modificación a Perl escrita por Rasmus Lerdorf a finales de 1994. Su primer uso fue para comprobar quién accedía a su curriculum en su web.\r\n\r\nTras ver toda la capacidad de rastreo que tenía PHP, lo reescribió para poder interactuar con bases de datos más grandes y fue en 1995 cuando Rasmus publicó el código fuente PHP Tools dando paso a todos los desarrolladores que quisieran utilizar la herramienta, además estos pudieron aportar soluciones a posibles errores de código.', '2022-08-18 03:00:00', );

